■スタッフより一言♪<br>
シンプルなハート型の両面コンパクトミラーです。<br>
くぼみがあるのでデコがしやすく、レジンを流し込んでもOK！<br>
デコパーツやビジュー、ラインストーン、レースなどお好きなパーツでデコってオリジナルのミラーを楽しんでくださいね♪<br><br>※デコ用品としての出品ですので、表面の塗装に点々のあるもの、または軽いキズ・ムラのあるものもございます。ご了承ください。<br> 製造ロットにより色差が生じる場合があります。<br>
